import React from 'react'

const Activate = () => {
    const { user } = useSelector((state) => ({ ...state }));

    return (
      <div className="home">
        <Header />
        <LeftHome user={user} />
        <div className="home_middle">
          <Stories />
          <CreatePost user={user} />
        </div>
        <RightHome user={user} />
      </div>
    );
}

export default Activate
